            if (typeof valA === 'string') return sortDesc ? valB.localeCompare(valA) : valA.localeCompare(valB);
            return sortDesc ? (valB - valA) : (valA - valB);
        });

        // ÂàÜÈ°µ
        const totalPages = Math.ceil(filteredAndSortedData.length / pageSize);
        if(currentPage > totalPages) currentPage = Math.max(1, totalPages);
        const startIdx = (currentPage - 1) * pageSize;
        const endIdx = startIdx + pageSize;
        const pageData = filteredAndSortedData.slice(startIdx, endIdx);

        // Êõ¥Êñ∞ÂàÜÈ°µ‰ø°ÊÅØ
        document.getElementById('pageInfo').innerText = `Á¨¨ ${currentPage} / ${totalPages || 1} È°µ (ÂÖ± ${filteredAndSortedData.length} Êù°)`;

        let html = [];
        pageData.forEach(item => {
            let balStr = item.bal.toLocaleString('en-US', {maximumFractionDigits: 0});
            let pctStr = item.pct.toFixed(2) + "%";
            let chgClass = "flat", chgText = "-";
            if(item.change > 0) {
                chgClass="up";
                chgText = "+" + item.change.toLocaleString('en-US', {maximumFractionDigits: 0}) + " ‚ñ≤";
            }
            else if(item.change < 0) {
                chgClass="down";
                chgText = item.change.toLocaleString('en-US', {maximumFractionDigits: 0}) + " ‚ñº";
            }

            // BIS SWAP ÂáÄÊµÅÂÖ• = ËΩ¨ÂÖ• - ËΩ¨Âá∫
            let bisSwapNet = item.bis_swap_in - item.bis_swap_out;
            let bisSwapNetStr = "";
            if(bisSwapNet > 0) {
                bisSwapNetStr = `<span style="color:#4caf50">+${bisSwapNet.toLocaleString('en-US', {maximumFractionDigits: 0})}</span>`;
            } else if(bisSwapNet < 0) {
                bisSwapNetStr = `<span style="color:#f44336">${bisSwapNet.toLocaleString('en-US', {maximumFractionDigits: 0})}</span>`;
            } else {
                bisSwapNetStr = '<span style="color:#666">0</span>';
            }

            // BIS AMM ÂáÄÊµÅÂÖ• = ËΩ¨ÂÖ• - ËΩ¨Âá∫
            let bisAmmNet = item.bis_amm_in - item.bis_amm_out;
            let bisAmmNetStr = "";
            if(bisAmmNet > 0) {
                bisAmmNetStr = `<span style="color:#4caf50">+${bisAmmNet.toLocaleString('en-US', {maximumFractionDigits: 0})}</span>`;
            } else if(bisAmmNet < 0) {
                bisAmmNetStr = `<span style="color:#f44336">${bisAmmNet.toLocaleString('en-US', {maximumFractionDigits: 0})}</span>`;
            } else {
                bisAmmNetStr = '<span style="color:#666">0</span>';
            }

            // ÊÄªÂíå = ÊåÅ‰ªì + BIS SWAPÂáÄÈ¢ù + BIS AMMÂáÄÈ¢ù
            let totalBalanceStr = item.total_balance.toLocaleString('en-US', {maximumFractionDigits: 0});

            let tags = "";
            // Â∑≤ÂçñÂÆåÊ†áÁ≠æ
            if(item.status === "SOLD_OUT") tags += "<span class='soldout-tag'>üí∏ Â∑≤ÂçñÂÆå</span>";
            // ÊµÅÂä®ÊÄßÊèê‰æõËÄÖÊ†áÁ≠æ
            if(item.status === "LP") tags += "<span class='lp-tag'>üíß LP</span>";
            // ‰∫§ÊòìËÄÖÊ†áÁ≠æ
            if(item.status === "TRADER") tags += "<span class='trader-tag'>üîÑ ‰∫§Êòì</span>";
            // Êñ∞Âú∞ÂùÄÊ†áÁ≠æ
            if(item.status === "NEW") tags += "<span class='new-tag'>üî• NEW</span>";
            // ÂõûÂΩíÊ†áÁ≠æ
            if(item.status === "RETURN") tags += "<span class='ret-tag'>‚ôªÔ∏è ÂõûÂΩí</span>";

            if(item.note) {
                if(item.note.includes("MINT")) {
                     let cleanNote = item.note.replace("üéÅ [MINT] ", "");
                     tags += "<span class='mint-tag'>MINT</span>";
                     if(cleanNote) tags += "<span class='rem'>" + cleanNote + "</span> ";
                } else {
                     tags += "<span class='rem'>" + item.note + "</span> ";
                }
            }

            html.push(`
                <tr>
                    <td>#${item.rank}</td>
                    <td>${tags}<span class="addr-0x">${item.key}</span><span class="addr-btc">${item.btc}</span></td>
                    <td style="color:#fff;font-weight:bold">${balStr}</td>
                    <td>${bisSwapNetStr}</td>
                    <td>${bisAmmNetStr}</td>
                    <td style="color:#00bcd4;font-weight:bold">${totalBalanceStr}</td>
                    <td style="color:#aaa">${pctStr}</td>
                    <td class="${chgClass}">${chgText}</td>
                    <td><button class="btn" onclick="show('${item.key}')">üìà</button></td>
                </tr>
            `);
        });
        tbody.innerHTML = html.join('');
    }

    function changePageSize() {
        const sizes = [50, 100, 200, 500];
        const currentIdx = sizes.indexOf(pageSize);
        pageSize = sizes[(currentIdx + 1) % sizes.length];
        document.getElementById('pageSizeLabel').innerText = pageSize;
        currentPage = 1;
        render();
    }

    function prevPage() {
        if(currentPage > 1) {
            currentPage--;
            render();
        }
    }

    function nextPage() {
        const totalPages = Math.ceil(filteredAndSortedData.length / pageSize);
        if(currentPage < totalPages) {
            currentPage++;
            render();
        }
    }

    function sort(col) {
        if(sortCol === col) sortDesc = !sortDesc;
        else { sortCol = col; sortDesc = true; }
        render();
    }

    let myChart;
    function show(key) {
        document.getElementById('modal').style.display='block';
        if(myChart) myChart.destroy();
        const pts = chartData[key];
        if(!pts) return;

        // ËÆ°ÁÆóÊúÄÂ§ßÂÄºÔºåÁî®‰∫éËÆæÁΩÆYËΩ¥ËåÉÂõ¥
        const maxY = Math.max(...pts.map(p=>p.y));
        const yAxisMax = maxY > 0 ? Math.ceil(maxY * 1.1) : 100;  // Áïô10%È°∂ÈÉ®Á©∫Èó¥

        myChart = new Chart(document.getElementById('c'), {
            type: 'line',
            data: {
                labels: pts.map(p=>p.t),
                datasets: [{
                    label: 'ÊÄªÊåÅ‰ªìÈáè (ÂåÖÂê´BIS)',
                    data: pts.map(p=>p.y),
                    borderColor: '#00bcd4',
                    backgroundColor: 'rgba(0,188,212,0.1)',
                    fill: true,
                    pointRadius: 3,
                    tension: 0.1
                }]
            },
            options: {
                maintainAspectRatio: false,
                plugins: {
                    title: {
                        display: true,
                        text: 'Âú∞ÂùÄ: '+key + ' - ÊÄªÊåÅ‰ªìË∂ãÂäø (ÂåÖÂê´BIS SWAPÂíåBIS AMM)',
                        color:'#fff',
                        font:{size:14}
                    },
                    legend: {
                        labels: {
                            color: '#ccc'
                        }
                    }
                },
                scales: {
                    y: {
                        beginAtZero: true,  // Á∫µÂùêÊ†áËΩ¥‰ªé0ÂºÄÂßã
                        min: 0,
                        max: yAxisMax,     // Ê†πÊçÆÊï∞ÊçÆÂä®ÊÄÅË∞ÉÊï¥ÊúÄÂ§ßÂÄº
                        grid: {
                            color: '#333'
                        },
                        ticks: {
                            color: '#aaa'
                        },
                        title: {
                            display: true,
                            text: '‰ª£Â∏ÅÊï∞Èáè',
                            color: '#888'
                        }
                    },
                    x: {
                        grid: {
                            color: '#333'
                        },
                        ticks: {
                            color: '#aaa',
                            maxTicksLimit: 10
                        }
                    }
                }
            }
        });
    }

    window.onclick = function(e){if(e.target==document.getElementById('modal'))document.getElementById('modal').style.display='none';}
    render();
    </script>
